import React, {useState,useEffect} from 'react';
import axios from 'axios';


function App(){
    const [first, data] = useState('데이터 없음')
    const res = axios.get('/')
    const name = res.name

    useEffect(()=>{
        data(name);
	}, [])

    return(
        <div className='App'>
            <h1> {first} </h1>

        </div>
    )
}

export default App;
